import React from 'react';
import classes from './Toolbar.module.css';
import NavItem from '../NavItem/NavItem';

const toolbar = props => (
    <div className = {classes.Toolbar}>
        <NavItem><p>aaa</p></NavItem>
        <NavItem>sss</NavItem>
    </div>
);

export default toolbar;
